import React from "react";

const Message = () => {
  return (
    <div className=" flex flex-col justify-center items-center h-screen m-48 border-8 border-gray-100">
      <h1 className=" font-ubuntu text-white text-4xl"> Send me a message!</h1>
      <p className=" text-white text-2xl text-center mt-6">
        Got a question or proposal, or just want <br /> to say hello? Go ahead.
      </p>

      <form className=" flex justify-between w-[60%] ">
        <div>
          <label className=" text-white" for="name">
            {" "}
            Full Name:{" "}
          </label>
          <input
            type="text"
            className=" w-ful bg-transparent border-b-2 text-white text-center border-white"
          />
        </div>
        <div>
          <label className=" text-white" for="email">
            {" "}
            Email Address:{" "}
          </label>
          <input
            type="email"
            className=" bg-transparent border-b-2 text-white text-center border-white"
          />
        </div>
      </form>
    </div>
  );
};

export default Message;
